import React from 'react'
import Grid from '@material-ui/core/Grid'
import Paper from '@material-ui/core/Paper'
function RenderRow({ row }) {
        //var rowvals={row}.toString().split("").map((x)=>+x);
        return(
            <div>
                {row.map((item)=>{
                    return(
                    <span>Item={item} </span>
                    )
                })}
            </div>
        )
}
function renderRowFunc(row){
    row.forEach((item)=>{
        console.log(item);
    })
}
const Ticket = ({ticket}) => {
    //console.log({row1}.toString());
    ticket.forEach((row)=>{
        console.log("ROW");
        renderRowFunc(row);
    })
    return(
        <div>

        </div>
    )
}
export default Ticket;
